import React, { useState, useEffect } from "react";
import axios from "axios";



const App = () => {
  const [data, setData] = useState({ hits: [] });

  useEffect(() => {
    const fetchData = async () => {
      const result = await axios("http://localhost:8000");

      setData(result.data);
    };

    fetchData();
  }, []);
  return (
    <div>
      <h1>{data}</h1>
    </div>
  );
};

export default App;
